[WebMethod]\npublic static List<User> SearchUsers(string search)\n{\n    // Replace with your actual data retrieval logic\n    List<User> users = new List<User>();\n    \n    // Sample data\n    users.Add(new User { UserId = 1, Username = "JohnDoe", Email = "john@example.com" });\n    users.Add(new User { UserId = 2, Username = "JaneDoe", Email = "jane@example.com" });\n    \n    return users.Where(u => u.Username.Contains(search)).ToList();\n}\n\npublic class User\n{\n    public int UserId { get; set; }\n    public string Username { get; set; }\n    public string Email { get; set; }\n}